import React from "react";
import Movie from "/.Movie";

class MovieList extends Component {
  render() {
    const movies = [
      { title: "A Movie", rating: "PG-13", description: "this is a movie" },
      {
        title: "Another Movie",
        rating: "R",
        description: "this is another movie"
      },
      {
        title: "A Third Movie",
        rating: "PG",
        description: "this is yet another movie"
      },
      {
        title: "A Fourth Movie",
        rating: "PG",
        description: "this is yet another movie"
      },
      {
        title: "A Fifth Movie",
        rating: "PG",
        description: "this is yet another movie"
      },
      {
        title: "A Sixth Movie",
        rating: "PG",
        description: "this is yet another movie"
      }
    ];
    const movieComponents = movies.map((movie, index) => {
      return <Movie movie={movie} key={index} />;
    });

    console.log(movieComponents)
    return (
      {movieComponents}
    );
  }
}

export default MovieList;
